def get_skinbid_discount_by_percent(skin_name):
    formatted_name = skin_name.replace(" ", "%20").replace("|", "%7C").replace("★", "%E2%98%85")
    url = f"https://skinbid.com/market/csgo/{formatted_name}"
    headers = {"User-Agent": "Mozilla/5.0"}
    response = requests.get(url, headers=headers)
    if response.status_code != 200:
        return None, None
    soup = BeautifulSoup(response.text, "html.parser")

    # Căutăm procentul de reducere gen "-17%" în verde
    discount_elements = soup.find_all("span", class_="text-green-500")
    price_element = soup.find("span", class_="font-bold text-white text-xl")

    if discount_elements and price_element:
        for d in discount_elements:
            text = d.get_text(strip=True).replace("%", "").replace("-", "")
            try:
                discount = float(text)
                if discount >= 11:
                    price_text = price_element.text.strip().replace("€", "").replace("$", "").replace(",", "")
                    return float(price_text), discount
            except ValueError:
                continue
    return None, None

async def send_alert(skin, price, discount):
    bot = Bot(token=TELEGRAM_TOKEN, request=HTTPXRequest())
    message = (
        f"🔥 *Reducere pe SkinBid!*\n"
        f"*{skin}*\n"
        f"💰 Preț actual: {price:.2f}€\n"
        f"📉 Discount: -{discount:.2f}%"
    )
    await bot.send_message(chat_id=CHAT_ID, text=message, parse_mode="Markdown")

async def send_info_message(text):
    bot = Bot(token=TELEGRAM_TOKEN, request=HTTPXRequest())
    await bot.send_message(chat_id=CHAT_ID, text=text)

async def main():
    await send_info_message("🔍 Verific reduceri vizibile pe SkinBid (minim 11%)...")
    found = False
    for skin in skins:
        price, discount = get_skinbid_discount_by_percent(skin)
        if discount:
            found = True
            await send_alert(skin, price, discount)
    if not found:
        await send_info_message("⚠️ Nicio reducere peste 11% găsită în acest ciclu.")

while True:
    try:
        asyncio.run(main())
    except Exception as e:
        print(f"Eroare: {e}")
    print("🔁 Pauză 15 minute...")
    time.sleep(900)
